import React from 'react';
import './ProgramDetail.css';

const ArtsAcademy = () => {
  return (
    <div className="program-detail">
      <div className="program-hero" style={{ backgroundImage: `url('https://images.unsplash.com/photo-1577896851231-70ef18881754?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80')` }}>
        <div className="hero-overlay"></div>
        <div className="hero-content">
          <h1>Arts Academy</h1>
          <p>Comprehensive visual and performing arts education to foster creativity and self-expression.</p>
        </div>
      </div>
      <div className="program-content">
        <h2>About Arts Academy</h2>
        <p>Our Arts Academy provides students with opportunities to explore their creativity through visual arts, music, theater, and dance. We encourage self-expression and artistic growth.</p>
        <img src="https://images.unsplash.com/photo-1577896851231-70ef18881754?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80" alt="Arts Academy" />
      </div>
    </div>
  );
};

export default ArtsAcademy;
